import { Link } from "react-router-dom";

const Card = ({ _id, dish, country, name, image }) => {
  return (
    <div className="recipe-card" key={_id}>
      <Link to={`/recipes/${_id}`}></Link>
      <h2>{dish}</h2>
      <h3>{country}</h3>
      <img src={image} alt={name} className="w-full h-[200px] object-cover" />
    </div>
  );
};

export default Card;
